import React from "react";
import PlaceItem from "./PlaceItem";
// import { motion } from "framer-motion";

const ImageGrid = ({ places }) => {
    return (
        <div className="img-grid">
            {places && places.map((place) => <PlaceItem />)}
        </div>
    );
};

export default ImageGrid;
